{
  "title": "Grilled Steak Sandwich",
  "ingredients": [
    "2 red bell peppers",
    "2 tbsp olive oil",
    "1 red onion",
    "1 head of lettuce",
    "2 tomatoes",
    "4 slices of sirloin steak (approx. 125 g each)",
    "4 tbsp butter",
    "Salt",
    "Black pepper",
    "4 large slices of white bread (preferably sourdough)",
    "2 dl bearnaise sauce",
    "1 bunch of parsley"
  ],
  "instructions": [
    "Preheat the oven to 225°C.",
    "Cut the bell peppers into quarters and remove the seeds. Place them on a baking sheet lined with parchment paper, skin side up. Drizzle olive oil over them.",
    "Roast the bell peppers in the middle of the oven for about 15 minutes. Let them cool down and remove the skin.",
    "Peel and thinly slice the red onion, preferably using a mandoline. Separate the lettuce leaves and rinse them. Slice the tomatoes.",
    "Grill or fry the steak for 2-3 minutes per side. If frying, use half of the butter. Season with salt and pepper.",
    "Grill or fry the bread slices. If frying, use the remaining butter.",
    "Place the bread slices on 4 plates. Slice the steak and distribute it, along with the lettuce, tomatoes, bell peppers, and red onion, on top of the bread slices.",
    "Top with bearnaise sauce and garnish with parsley."
  ],
