{
  "title": "Pasta Primavera",
  "ingredients": [
    "120g fava beans, shucked",
    "120g English peas, shucked",
    "Kosher salt",
    "225g asparagus, woody ends removed, stalks cut into 1-inch pieces",
    "170g snap peas, strings removed, cut into 1/2-inch slices",
    "170g broccolini, woody ends removed, cut into 1-inch pieces",
    "50g unsalted butter",
    "30ml extra-virgin olive oil, plus more for serving",
    "2 whole cloves garlic, lightly smashed",
    "90g pine nuts",
    "450g fresh egg pasta, such as fettuccine, penne, or gemelli",
    "170ml crème fraîche",
    "5g finely grated zest of 1 lemon",
    "5ml fresh lemon juice",
    "15g minced fresh basil leaves",
    "15g minced fresh parsley leaves",
    "Freshly grated Parmigiano-Reggiano, to taste",
    "Freshly ground black pepper"
  ],
  "instructions": [
    "If using fava beans, shuck the beans from their pods. Discard the pods. Repeat process for English peas.",
    "Bring a large pot of salted water to a boil. Prepare an ice bath.",
    "Blanch the fava beans, peas, asparagus, snap peas, and broccolini in the boiling water for 1 minute each. Transfer to the ice bath to cool, then pat dry with paper towels. Remove and discard the skin from each fava bean. Set the vegetables aside.",
    "Empty the pot and refill with fresh water. Season generously with salt and return to a boil.",
    "In a saucier or skillet, heat the butter, olive oil, garlic, and pine nuts over low heat until gently sizzling. Cook, swirling the pan constantly, until the pine nuts just start to brown and the garlic aroma is very strong. Do not let the butter brown. Remove from heat occasionally if it starts to sizzle too rapidly. Discard the garlic cloves.",
    "Add the blanched vegetables to the pan and toss to combine. Remove from heat.",
    "Meanwhile, cook the pasta in the boiling water until just shy of al dente, about 1 minute less than the package directions indicate. Drain the pasta, reserving 1 cup of cooking liquid.",
    "Transfer the pasta to the pan with the vegetables. Add the crème fraîche, lemon zest, lemon juice, basil, and parsley. Set over high heat and cook, stirring and tossing constantly, adjusting the consistency as necessary with a few splashes of starchy pasta water, until the liquid reduces to a creamy sauce. The sauce should coat the pasta and leave a creamy trail on the bottom of the pan when you drag a wooden spoon through it.",
    "Off heat, stir in generous shavings of fresh Parmigiano-Reggiano and season to taste with salt and pepper.",
    "Serve immediately, drizzling with olive oil and sprinkling with freshly ground black pepper and grated Parmigiano-Reggiano at the table."
  ],
