{
  "title": "Sunshine Egg Salad with Dukkah & Sweet Pepper Grains",
  "ingredients": [
    "2 tablespoons dukkah",
    "1 x 250 g packet mixed cooked grains",
    "½ x 460 g jar roasted red peppers",
    "200 g baby spinach",
    "4 large free-range eggs",
    "½ pomegranate",
    "2 heaped tablespoons natural yoghurt"
  ],
  "instructions": [
    "Put a large pan of salted water on to simmer for your eggs.",
    "Toast most of the dukkah in a large non-stick frying pan on medium heat for 2 minutes, then tip in the grains.",
    "Drain and finely chop the peppers, then add them to the pan. Cook and stir for 5 minutes, season to perfection, then divide between your plates.",
    "Return the pan to the heat and quickly wilt the spinach. Season to perfection and divide it over the grains.",
    "Meanwhile, crack each egg into the simmering water in one fluid movement and poach for 3 minutes, or until cooked to your liking.",
    "Squeeze a little pomegranate juice into a bowl, ripple through the yogurt, then bash the pomegranate half with the back of a spoon so the remaining seeds tumble out.",
